import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
// import { Route } from "react-router-dom/cjs/react-router-dom.min";
import Users from "./Users/Pages/Users";
const App = () => {
  return (
    <Router>
      <Route path="/">
        <Users />
      </Route>
    </Router>
  );
};

export default App;
